import React, { useEffect, useState } from "react";

export default function PokedexEntry({ species }) {

  return (
    <div>
      <h2>Pokedex Entry</h2>
      {species && species.flavor_text_entries.language.name == "en" && species.flavor_text_entries.map((entry, index) => (
        <p key={index}>{entry.flavor_text}</p>
      )) }
    </div>
  );
}
